- en: 'These graphs were generated in week 2024-21 with data from 26 participating
    countries: Austria, Belgium, Cyprus, Denmark, Estonia, Finland, France, Germany,
    Greece, Hungary, Ireland, Israel, Italy, Luxembourg, Malta, Netherlands, Norway,
    Portugal, Slovenia, Spain, Sweden, Switzerland, UK (England), UK (Northern Ireland),
    UK (Scotland), and UK (Wales).'
  id: totrans-split-8
  prefs: []
  type: TYPE_NORMAL
  zh: 这些图表是在2024年第21周生成的，使用了来自26个参与国家的数据：奥地利，比利时，塞浦路斯，丹麦，爱沙尼亚，芬兰，法国，德国，希腊，匈牙利，爱尔兰，以色列，意大利，卢森堡，马耳他，荷兰，挪威，葡萄牙，斯洛文尼亚，西班牙，瑞典，瑞士，英国（英格兰），英国（北爱尔兰），英国（苏格兰）和英国（威尔士）。
